By Council Members Greenfield and Dickens

      WHEREAS, the City Planning Commission filed with the Council on February 20, 2015 its decision dated February 18, 2015 (the "Decision"), on the application submitted by the New York City Department of Housing Preservation and Development ("HPD") pursuant to Section 197-c of the New York City Charter and Article 16 of the General Municipal Law of New York State regarding:

a)	the designation of property located at 54-25 101st Street (Block 1939, Lot 11), as an Urban Development Action Area (the "Area");

b) an Urban Development Action Area Project for the Area (the "Project"); and 

pursuant to Section 197-c of the New York City Charter for the disposition of city-owned property located at 54-25 101st Street (Block 1939, Lot 11) to a developer to be selected by the New York City Department of Housing Preservation and Development to facilitate the development of an eight-story mixed-use building with approximately 67 units of affordable housing for senior citizens, Community District 4, Borough of Queens (ULURP No. C 150126 HAQ) (the "Application");

	WHEREAS, the application is related to Application C 150125 ZMQ (L.U. No. 185), an amendment to the Zoning Map, Section No. 10b, changing from an R6B District to an R6 District;

      WHEREAS, the Decision is subject to review and action by the Council pursuant to Section 197-d(b)(1) of the City Charter;

      WHEREAS, the Application and Decision are subject to review and action by the Council pursuant to Article 16 of the General Municipal Law of New York State;

      WHEREAS, by letter dated February 9, 2015 and submitted to the Council on February 18, 2015, HPD submitted its requests (the "HPD Requests") respecting the Application including a project summary (the "Project Summary");

  	WHEREAS, upon due notice, the Council held a public hearing on the Application and Decision on March 9, 2015;

  	WHEREAS, the Council has considered the land use and financial implications and other policy issues relating to the Application;

      WHEREAS, the Council has considered the relevant environmental issues including the negative declaration (CEQR No. 15HPD012Q) issued on October 14, 2014 (the "Negative Declaration");

RESOLVED:

	The Council finds that the action described herein will have no significant impact on the environment as set forth in the Negative Declaration.

  	Pursuant to Section 197-d of the New York City Charter, based on the environmental determination and the consideration described in the report (C 150126 HAQ) and incorporated by reference herein, the Council approves the Decision of the City Planning Commission and the HPD Requests.

  	The Council finds that the present status of the Project Area tends to impair or arrest the sound growth and development of the City of New York and that a designation of the Project as an urban development action area project is consistent with the policy and purposes stated in Section 691 of the General Municipal Law.

  	The Council approves the designation of the Project Area as an urban development action area pursuant to Section 693 of the General Municipal Law.

  	The Council approves the project as an urban development action area project pursuant to Section 694 of the General Municipal Law (the "Project") and subject to the terms and conditions of the Project Summary.

  	The Project shall be developed in a manner consistent with the project summary submitted by HPD on February 19, 2015, a copy of which is attached hereto and made a part hereof.

	The Council approves the disposition of 54-25 101st Street (Block 1939, Lot 11) to a developer selected by the New York City Department of Housing Preservation and Development.

Adopted.

